import React from 'react';
import logo from './logo.svg';
import './App.css';


function Welcome() {
  return (
    <div className='Welcome'>
      Welcome to the game.
    </div>
  )
}

function App() {
  return (
    <div className='App'>
      <Welcome />
    </div>
  );
}

export default App;
